import { Component } from "react";
import Body from "./Body/Body";
import Head from "./Head/Head";

import "./HomePage.css"

class HomePage extends Component
{
    _id:string|number = ""
    state = {
        displaySenderInformation : false,
        data : {
            id : this._id,
            email: "",
            name: "",
            category: "",
        }
    }
    props:any = this.props

    openConversation = (email:string, id:number|string, name:string, category:string|number) => {
        if(email !== "" && id !== "" && name !== "" && category !== null)
        this.setState({data: {email, id, name, category}, displaySenderInformation: true})
        console.log({email, id, name, category})

    }

    render(){
        return (
            <div className="home-page">
                <Head disPlaySenderInformation = {this.state.displaySenderInformation} data = {this.state.data} />
                <Body openConversation = {this.openConversation} />
            </div>
        )
    }
}

export default HomePage
